import "babel-polyfill";
import { sp } from "@pnp/sp";

sp.setup({
  sp: {
    headers: {
      Accept: "application/json;odata=verbose",
    },
    //baseUrl: "http://spdev"
  },
});
async function getWeb(){
    const w =  await sp.web.get();
    console.log(w);
};
getWeb();
